// src/components/Dashboard.js

import React from 'react';
import { Line } from 'react-chartjs-2';
import { Chart as ChartJS, LineElement, CategoryScale, LinearScale, Title } from 'chart.js';

// Registering components
ChartJS.register(LineElement, CategoryScale, LinearScale, Title);

const Dashboard = () => {
    // Data for the line chart
    const data = {
        labels: ['2024-08-01', '2024-08-02', '2024-08-03', '2024-08-04'],
        datasets: [
            {
                label: 'DNS Query Response Time',
                data: [120, 80, 95, 110],
                borderColor: 'rgba(75,192,192,1)',
                backgroundColor: 'rgba(75,192,192,0.2)', // Optional for a background color under the line
                fill: true, // Optional to fill the area under the line
            },
        ],
    };

    return (
        <div>
            <h2>DNS Query Response Time</h2>
            <Line data={data} />
        </div>
    );
};

export default Dashboard;
